column8:
D.A.Dラグジュアリー クッション タイプ ディルス<br><br>


■サイズ： H470mm×W470mm マチ43mm<br>
■素材：PUレザー<br>
■カラー：ブラック/ホワイト<br><br>
車内インテリアのドレスアップやロングドライブを快適にさせる単座用クッション。<br>
内部クッションには立体裁断を採用し、型崩れを防ぎます。


<br>
<br>
妥協なきこだわりを注ぎ込んだ、D.A.Dの新シリーズ「DILUS」が登場!!<br>
アメリカンラグジュアリーテイストをイメージしたデザインの「TYPE DILUS」。<br>
こだわりぬいたクオリティーデザインは生地にも。厚さ、柔らかさ、そしてカラーを何度も吟味し、擦れても色落ちしない特殊コーティング加工を施しています。<br>
また、エンブレムやスタッズひとつにとっても、アイテムによってサイズやピッチを計算しつくした一切の妥協なきデザインとなっています。<br>
D.A.Dのこだわりが詰まったアメリカンラグジュアリーデザインで車内をコーディネートすれば、さらに新しい世界観が生まれることでしょう。
<br><br>

【ご注意】<br>
こちらの商品はメーカーより取り寄せ商品となります。<br>
在庫がある場合は即日発送可能ですが、在庫がない場合は納期１週間～２週間いただく場合がございます。<br>
お急ぎの方は事前にお問い合わせ下さい。<br>







